  if (!window.dpAppRunner) {
      // pass app data via props if in local (static) mode, otherwise this data is fetched from the server
      window.reportProps["appData"] = { data: { result: {"view_xml": "\u003cView version=\"1\" fragment=\"false\"\u003e\u003cText\u003e\u003c![CDATA[# Binnewitt \\\u0026 Schnepf 2023 (Erg\u00e4nzende Materialien)\n\nDies ist das erg\u00e4nzende Material zum Artikel\n\n```Binnewitt, Johanna; Schnepf, Timo (2023): \nJoin us to turn the wor(l)d greener! \u2013 \nInvestigating online apprenticeship advertisements\u2019 reference to environmental sustainability. \nIn: Zum Konzept der Nachhaltigkeit in Arbeit, Beruf und Bildung - Stand in Forschung und Praxis. AG BFN.```\n\nEs besteht aus Folgendem:\n\n1. Treemap-Diagramm f\u00fcr die am h\u00e4ufigsten gefundenen Schl\u00fcsselw\u00f6rter in den drei Assoziations-Kategorien\n2. Liniendiagramme zur Entwicklung von Schl\u00fcsselw\u00f6rtern auf Berufsebene\n3. Vortrag im Bertelsmann OJA Forum 2021\n\nDen Artikel finden Sie [hier](https://www.bibb.de/dienst/publikationen/de/19032?referrer=/dienst/publikationen/de/suche?publication_search_result_voe%255BfreeTextSearch%255D%3Dschnepf%2520_author:5350%26publication_search_result_voe%255BfromYear%255D%3D%26publication_search_result_voe%255BtoYear%255D%3D%26publication_search_result_voe%255Bseries%255D%3D%26publication_search_result_voe%255Blanguage%255D%3D).\n\nDie Keyword-Liste finden Sie [auf bibb.de.](https://www.bibb.de/de/153062.php)\n\n## 1. Treemap der Funde \u00f6kol. Begriffe in Stellenanzeigen\n\nDie Gr\u00f6\u00dfe der Quadrate repr\u00e4sentiert die Anzahl der Ausbildungsstellenanzeigen im Korpus. Die Farbgebung repr\u00e4sentiert\ndie Anzahl der Schl\u00fcsselwort\u00fcbereinstimmungen. Je gr\u00fcner das Quadrat, desto mehr \"gr\u00fcne\" Schl\u00fcsselw\u00f6rter wurden pro Beruf gefunden.\n\nSie k\u00f6nnen die Maus \u00fcber die Treemap bewegen, um weitere Informationen \u00fcber den Prozentsatz der Stellenanzeigen\u00fcbereinstimmungen, welche Schl\u00fcsselw\u00f6rter \n\u00fcbereinstimmten und wie oft sie \u00fcbereinstimmten, zu erhalten. Das Bewegen der Maus \u00fcber die Rahmen summiert die Schl\u00fcsselwort\u00fcbereinstimmungen\nf\u00fcr h\u00f6here Aggregationsebenen von Berufen (KldB 2010 3-stellig und 1-stellig). Sie k\u00f6nnen durch Klicken auf die \ninteressierenden Rahmen hineinzoomen. F\u00fcr mobile Ger\u00e4te die Quadrate l\u00e4nger ber\u00fchren, um weitere Informationen zu erhalten.\n\nUnten k\u00f6nnen Sie die Schl\u00fcsselwort\u00fcbereinstimmungen nach ihrer Zugeh\u00f6rigkeit zur Umweltnachhaltigkeit (ES) filtern:]]\u003e\u003c/Text\u003e\u003cSelect type=\"dropdown\"\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" label=\"Nur schwach mit \u00f6kol. Nachhaltigkeit assoziierte Schl\u00fcsselw\u00f6rter anzeigen\" responsive=\"true\" scale=\"1.0\" src=\"ref://b4b6ea0198\" caption=\"Treemap zeigt alle schwach assoziierten Schl\u00fcsselwort\u00fcbereinstimmungen mit allen Ausbildungsstellenanzeigen von 2011 bis 2019.\"/\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" label=\"Nur mittelm\u00e4\u00dfig mit \u00f6kol. Nachhaltigkeit assoziierte Schl\u00fcsselw\u00f6rter anzeigen\" responsive=\"true\" scale=\"1.0\" src=\"ref://29a5bea867\" caption=\"Treemap zeigt alle mittelm\u00e4\u00dfig assoziierten Schl\u00fcsselwort\u00fcbereinstimmungen mit allen Ausbildungsstellenanzeigen von 2011 bis 2019.\"/\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" label=\"Nur stark mit \u00f6kol. Nachhaltigkeit assoziierte Schl\u00fcsselw\u00f6rter anzeigen\" responsive=\"true\" scale=\"1.0\" src=\"ref://803d435bf6\" caption=\"Treemap zeigt alle stark assoziierten Schl\u00fcsselwort\u00fcbereinstimmungen mit allen Ausbildungsstellenanzeigen von 2011 bis 2019.\"/\u003e\u003c/Select\u003e\u003cText\u003e\u003c![CDATA[## 2. Entwicklung auf Berufsebene\n\nUnten k\u00f6nnen Sie einen Beruf von Interesse ausw\u00e4hlen. Wenn Sie mit der Maus \u00fcber das Liniendiagramm fahren, erhalten Sie weitere Einblicke wie \ndie entsprechenden Schl\u00fcsselw\u00f6rter f\u00fcr jede Kategorie und jedes Jahr. Sie k\u00f6nnen Kategorien in der Legende deaktivieren, indem Sie darauf klicken.\nF\u00fcr genauere Infos zu den Kategorien lesen Sie bitte den Buchbeitrag.]]\u003e\u003c/Text\u003e\u003cSelect type=\"dropdown\"\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" label=\"Landwirtschaft (o.S.) - Fachkraft (11102)\" responsive=\"true\" scale=\"1.0\" src=\"ref://c8a88e7662\" caption=\"Landwirtschaft (o.S.) - Fachkraft (11102)\"/\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" label=\"Nutztierhaltung - Fachkraft (11212)\" responsive=\"true\" scale=\"1.0\" src=\"ref://bc5c7779c7\" caption=\"Nutztierhaltung - Fachkraft (11212)\"/\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" label=\"Forstwirtschaft - Fachkraft (11712)\" responsive=\"true\" scale=\"1.0\" src=\"ref://6fb43f3ba6\" caption=\"Forstwirtschaft - Fachkraft (11712)\"/\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" label=\"GartenLandschaftsSportplatzb.-Fachkraft (12142)\" responsive=\"true\" scale=\"1.0\" src=\"ref://86ec1eba03\" caption=\"GartenLandschaftsSportplatzb.-Fachkraft (12142)\"/\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" label=\"Land-, Baumaschinentechnik - Fachkraft (25222)\" responsive=\"true\" scale=\"1.0\" src=\"ref://bb0d79453e\" caption=\"Land-, Baumaschinentechnik - Fachkraft (25222)\"/\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" label=\"Zweiradtechnik - Fachkraft (25252)\" responsive=\"true\" scale=\"1.0\" src=\"ref://e8c26c58cd\" caption=\"Zweiradtechnik - Fachkraft (25252)\"/\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" label=\"Automatisierungstechnik - Fachkraft (26122)\" responsive=\"true\" scale=\"1.0\" src=\"ref://075d2ab667\" caption=\"Automatisierungstechnik - Fachkraft (26122)\"/\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" label=\"Bauelektrik - Fachkraft (26212)\" responsive=\"true\" scale=\"1.0\" src=\"ref://f087b2fbfc\" caption=\"Bauelektrik - Fachkraft (26212)\"/\u003e\u003cPlot type=\"application/vnd.plotl
